import React, { useEffect, useState } from "react";
import './App.css'
import {Link} from 'react-router-dom';

function ArticleLists(props){
    const [articleList, setArticleList] = useState({
        data : {}
    });

    useEffect(()=> {
        setArticleList(props.ArticleLists);
    },[props.ArticleLists, articleList])

    const articleListArr = Array.from(articleList.data);

    return (
        <div>
            {articleListArr.map((article, index) => (
                <Article data={article} index={index} />
            ))}
        </div>
    )
}


function ArticleDetail({article}){
    const [articleDetail, setArticleDetail] = useState({
        data : {}
    });

    // callArticle(){
    //     async () => {
    //     const RES = await fetch(`/board/${article}`)
    //                     .then((res) => res.json())
    //     return setArticleDetail({articleDetail:RES});
    // }

    useEffect(()=> {
        async function fetchData() {
            const RES = await fetch(`/board/${article}`)
                            .then((res) => res.json());
    
            setArticleDetail({articleDetail:RES});
            console.log(articleDetail);
            return RES;
        }
        return setArticleDetail({articleDetail :fetchData()});
    }, [article, articleDetail])


    return(
        
        <li> Article Detail : 
            <b> ID : </b> <span> </span> <br/>
            <b> Title : </b> <span> </span> <br/>
            <b> Category : </b> <span> </span> <br/>
            <b> Content : </b> <span> </span> <br/>
            <b> Created By : </b> <span> </span> <br/>
            <b> Created At : </b> <span> </span> <br/>
            <b> Visit : </b> <span> </span> <br/>
            <li><b> Comment : </b> <span> 
                
                </span> <br/></li>
        </li>
    )
}


function handleClick(articleId){
        console.log("Button Clicked");
    return <ArticleDetail article={articleId} />
}


function Article({data, index}) {

    return (
        <li id="liNone" key={index}>
            <b>ID : </b> <span>{data.id}</span> <br/>
            <b>Title : </b> <span>{data.title}</span> <br/>
            <b>Category : </b> <span>{data.category_name}</span> <br/>
            <b>Created By : </b> <span>{data.created_id}</span> <br/>
            <b>Created At : </b> <span>{data.created_at}</span> <br/>
            <b>Visit : </b> <span>{data.visit_cnt}</span> <br/>
            <b>Comment : </b> <span>{data.comment_cnt}</span> <br/>
            {/* <Link to={`/board/${data.id}`} key={index}>{data.id} */}
            <nav>
                <Link to={`/board/${data.id}`}>
                <button id="btn-detail" onClick={()=>handleClick(data.id)}> Detail </button>
                </Link>
            </nav>
            {/* </Link> */}
        </li>
    );
}

export default ArticleLists;
